import React, { useState } from "react";
import "./CreatePost.css";
import { supabase } from "../client";

const CreatePost = () => {
  const [post, setPost] = useState({
    title: "",
    author: "",
    description: "",
    speed: "medium", // Default crewmate attribute values
    visibility: "medium",
    tasks: "normal",
  });

  const handleChange = (event) => {
    const { name, value } = event.target;
    setPost((prev) => {
      return {
        ...prev,
        [name]: value,
      };
    });
  };

  const createPost = async (event) => {
    event.preventDefault();

    const { error } = await supabase
      .from("Posts")
      .insert({
        title: post.title,
        author: post.author,
        description: post.description,
        speed: post.speed, // Include crewmate attributes in the database
        visibility: post.visibility,
        tasks: post.tasks,
      })
      .select();

    if (error) {
      console.log(error);
    }

    window.location = "/";
  };

  return (
    <div>
      <form>
        <label>Name</label> <br />
        <input
          type="text"
          id="title"
          name="title"
          value={post.title}
          onChange={handleChange}
        />
        <br />
        <br />
        <label>Occupation</label>
        <br />
        <input
          type="text"
          id="author"
          name="author"
          value={post.author}
          onChange={handleChange}
        />
        <br />
        <br />
        <label>Bio</label>
        <br />
        <textarea
          name="description"
          rows="5"
          cols="50"
          id="description"
          value={post.description}
          onChange={handleChange}
        ></textarea>
        <br />
        <label>Crewmate Attributes</label>
        <br />
        <label>Speed:</label>
        <input
          type="radio"
          name="speed"
          value="slow"
          checked={post.speed === "slow"}
          onChange={handleChange}
        />{" "}
        Slow
        <input
          type="radio"
          name="speed"
          value="medium"
          checked={post.speed === "medium"}
          onChange={handleChange}
        />{" "}
        Medium
        <input
          type="radio"
          name="speed"
          value="fast"
          checked={post.speed === "fast"}
          onChange={handleChange}
        />{" "}
        Fast
        <br />
        <label>Visibility:</label>
        <input
          type="radio"
          name="visibility"
          value="low"
          checked={post.visibility === "low"}
          onChange={handleChange}
        />{" "}
        Low
        <input
          type="radio"
          name="visibility"
          value="medium"
          checked={post.visibility === "medium"}
          onChange={handleChange}
        />{" "}
        Medium
        <input
          type="radio"
          name="visibility"
          value="high"
          checked={post.visibility === "high"}
          onChange={handleChange}
        />{" "}
        High
        <br />
        <label>Tasks:</label>
        <input
          type="radio"
          name="tasks"
          value="few"
          checked={post.tasks === "few"}
          onChange={handleChange}
        />{" "}
        Few
        <input
          type="radio"
          name="tasks"
          value="normal"
          checked={post.tasks === "normal"}
          onChange={handleChange}
        />{" "}
        Normal
        <input
          type="radio"
          name="tasks"
          value="many"
          checked={post.tasks === "many"}
          onChange={handleChange}
        />{" "}
        Many
        <br />
        <input type="submit" value="Submit" onClick={createPost} />
      </form>
    </div>
  );
};

export default CreatePost;
